// Importo Axios
import axios from "axios";

class SalutiService {
    getSalutiData = () => {
        // Ottengo la stringa dal servizio attivo sulla 8080
        return axios.get("http://localhost:8080/api/saluti");
    }

    getSalutiDataWithParam = (username) => {
        // Idem come sopra, ma si devono usare i tick
        return axios.get(`http://localhost:8080/api/saluti/${username}`);
    }
}

export default new SalutiService();
